import React from 'react'
import '../Pokemon/Pokemon.css'
const Pokemon = ({poke}) => {
    return (
        <div>
            {poke && poke.map(p => {
                <div>
                <h1>{p.name}</h1>
                <h2>Hola!</h2>
                </div>
                
            })}
        </div>
    )
}

export default Pokemon
